class Solution {
public:
	int max(const int &a, const int &b) { return a > b ? a : b; }
    int largestRectangleArea(vector<int>& heights) {
    	vector<int> &d = heights;
		int n = d.size();
		stack<int> lSt;
		lSt.push(n);
		for (int p = n - 1; p >= 0; p--) {
			while (lSt.top() < n && d[p] < d[lSt.top()]) {
				int u = lSt.top(); lSt.pop();
				lPos[u] = p + 1;
			}
			lSt.push(p);
		}
		while (lSt.top() < n) { lPos[lSt.top()] = 0; lSt.pop(); }
//		printf("lPos: ");
//		for (int i = 0; i < n; i++) printf("%d ", lPos[i]); printf("\n");
		stack<int> rSt;
		rSt.push(-1);
		for (int p = 0; p < n; p++) {
			while (rSt.top() >= 0 && d[p] < d[rSt.top()]) {
				int u = rSt.top(); rSt.pop();
				rPos[u] = p - 1;
			}
			rSt.push(p);
		}
		while (rSt.top() >= 0) { rPos[rSt.top()] = n - 1; rSt.pop(); }
//		printf("rPos: ");
//		for (int i = 0; i < n; i++) printf("%d ", rPos[i]); printf("\n");
		int ans = 0;
		for (int i = 0; i < n; i++)
			ans = max(ans, d[i] * (rPos[i] - lPos[i] + 1));
		return ans;
    }
};

